import { WatchCourseContext } from 'app/contexts'
import * as resourceguards from 'app/types/guards'
import * as React from 'react'

const AssessmentIntro = ({
  goBack,
  startAccessment,
}: {
  goBack: () => void
  startAccessment: () => void
}) => {

  const [ currentAssessmentDetails, setCurrentAssessmentDetails ] = React.useState<any>(null);

  const {
    activeResourceIndex,
    allResourses,
    courseDetails
  } = React.useContext(WatchCourseContext)

  const currentResource = allResourses[activeResourceIndex]


  React.useEffect(() => {
    if (resourceguards.isAssessment(currentResource)) {
      setCurrentAssessmentDetails(currentResource);
    }
  }, [ currentResource ])

  return (
    <div className="gap-4 flex flex-col items-stretch md:items-center md:p-8 p-4 px-0 justify-center">
      <h1 className="text-2xl hidden md:block font-medium text-center my-4">
        Welcome To Your Assessment
      </h1>
      <p className="text-2xl md:hidden font-medium text-center my-4">
        Welcome To Your Assessment
      </p>

      <div className='mb-10 mx-auto'>
        <Icon />
      </div>
      <div className="md:space-y-4 flex flex-col items-stretch px-4 text-center md:items-center my-4">
        <p className="text-xl font-medium my-2">
          { courseDetails?.name } ({ currentAssessmentDetails?.name })
        </p>
        <p className="text-muted mb-2">{ currentAssessmentDetails?.totalNumberOfQuestions } multiple choice questions</p>
        <div className="flex items-center justify-around gap-1 md:gap-4 my-6">
          <button
            onClick={goBack}
            className="px-8 md:px-9 py-3 border-2 border-app-pink rounded text-app-pink flex-1 md:flex-auto"
          >
            Go Back
          </button>
          <button
            onClick={startAccessment}
            className="px-8 md:px-9 py-3 border-2 bg-app-pink border-app-pink rounded text-white flex-1 md:flex-auto"
          >
            Start Assessment
          </button>
        </div>
      </div>
    </div>
  )
}

